import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import { useParams, useRouteMatch } from "react-router-dom";
import Tabla from "../componentes/tablas/Tabla";

const StudDetail = () => {
  const params = useParams();
  console.log(params.studId);
  const match = useRouteMatch();

  let columnas1 = (
    <tr>
      <th>Nombre</th>
      <th>Apellido</th>
      <th>Cedula</th>
      <th>%</th>
    </tr>
  );

  let columnas2 = (
    <tr>
      <th>Nombre</th>
      <th>Apellido</th>
      <th>Cedula</th>
      <th>Record</th>
      <th>Dinero</th>
    </tr>
  );

  const informacion1 = [
    {
      id: "1",
      nombre: "Alejandro",
      apellido: "Marquez",
      cedula: "28.308.632",
      porcentaje: 54,
    },
    {
      id: "2",
      nombre: "Jose",
      apellido: "Gimenez",
      cedula: "6.089.356",
      porcentaje: 28,
    },
    {
      id: "3",
      nombre: "Yohander",
      apellido: "Hernandez",
      cedula: "29.458.321",
      porcentaje: 18,
    },
  ];

  const informacion2 = [
    {
      id: "1",
      nombre: "Oscar",
      apellido: "Isaac",
      cedula: "28.308.632",
      record: "26-69",
      dinero: "1.200.696 Bs",
    },
    {
      id: "2",
      nombre: "Marco",
      apellido: "Gimenez",
      cedula: "6.089.356",
      record: "2-9",
      dinero: "200.000 Bs",
    },
    {
      id: "3",
      nombre: "Jerry",
      apellido: "Mina",
      cedula: "29.458.321",
      record: "30-36",
      dinero: "2.000.000 Bs",
    },
  ];

  return (
    <Container>
    
      <Row>
      <Col className="justify-content-center align-items-center mx-5">
        <Card>
          <Card.Header>
            <Row className="row row-cols-2">
              <Col className="col cols-3">
                <Row className="row row-cols-3">
                  <Col className="col-3">
                    <h6>COLORES:</h6>
                  </Col>
                  <Col
                    className="offset-3 col-2"
                    style={{ backgroundColor: "#DEC618" }}
                  ></Col>
                  <Col
                    className="col-2"
                    style={{ backgroundColor: "#9900FF" }}
                  ></Col>
                </Row>
              </Col>

              <Col className="d-flex justify-content-end">
                <h6>FECHA CREACION: 5/12/2006</h6>
              </Col>
            </Row>
          </Card.Header>

          <Card.Body>
            <Row className="text-center">
              <h6>PROPIETARIOS</h6>
            </Row>

            <Row>
              <Tabla
                titulo='PROPIETARIOS'
                columnas={columnas1}
                informacion={informacion1}
                funcion={(x) => (
                  <tr>
                    <td>{`${x.nombre}`}</td>
                    <td>{`${x.apellido}`}</td>
                    <td>{`${x.cedula}`}</td>
                    <td>{`${x.porcentaje}`}</td>
                  </tr>
                )}
              ></Tabla>
            </Row>
          </Card.Body>
        </Card>
      </Col>
      </Row>
    </Container>
  );
};

export default StudDetail;
